"use strict";(self.webpackChunkmy_website=self.webpackChunkmy_website||[]).push([[880],{8256:e=>{e.exports=JSON.parse('{"blogPosts":[{"id":"first-blog-post","metadata":{"permalink":"/blog/first-blog-post","editUrl":"https://github.com/facebook/docusaurus/tree/main/packages/create-docusaurus/templates/shared/blog/2024-03-04-memoir.md","source":"@site/blog/2024-03-04-memoir.md","title":"\ud68c\uace0\ub85d","description":"\ub098\uc758 \uccab JS \uc2a4\ud130\ub514","date":"2024-03-04T00:00:00.000Z","formattedDate":"March 4, 2024","tags":[{"label":"\uc790\ubc14\uc2a4\ud06c\ub9bd\ud2b8","permalink":"/blog/tags/\uc790\ubc14\uc2a4\ud06c\ub9bd\ud2b8"},{"label":"\ub9ac\uc561\ud2b8","permalink":"/blog/tags/\ub9ac\uc561\ud2b8"},{"label":"\ud504\ub85c\uc81d\ud2b8","permalink":"/blog/tags/\ud504\ub85c\uc81d\ud2b8"},{"label":"\uc2a4\ud130\ub514","permalink":"/blog/tags/\uc2a4\ud130\ub514"}],"readingTime":3.26,"hasTruncateMarker":false,"authors":[{"name":"\uc815\uc900\ud615","title":"\uad11\uc6b4\ub300\ud559\uad50 \uc18c\ud504\ud2b8\uc6e8\uc5b4\ud559\ubd80","url":"https://github.com/jungjunhyung99","image_url":"/img/me.png","imageURL":"/img/me.png"}],"frontMatter":{"slug":"first-blog-post","title":"\ud68c\uace0\ub85d","authors":{"name":"\uc815\uc900\ud615","title":"\uad11\uc6b4\ub300\ud559\uad50 \uc18c\ud504\ud2b8\uc6e8\uc5b4\ud559\ubd80","url":"https://github.com/jungjunhyung99","image_url":"/img/me.png","imageURL":"/img/me.png"},"tags":["\uc790\ubc14\uc2a4\ud06c\ub9bd\ud2b8","\ub9ac\uc561\ud2b8","\ud504\ub85c\uc81d\ud2b8","\uc2a4\ud130\ub514"]},"unlisted":false},"content":"## \ub098\uc758 \uccab JS \uc2a4\ud130\ub514\\n2023\ub144 1\ud559\uae30, **\ubaa8\ub358 \uc790\ubc14\uc2a4\ud06c\ub9bd\ud2b8 Deep Dive** \ucc45\uc73c\ub85c \ub098\uc758 \uccab \uc2a4\ud130\ub514\ub97c \uc9c4\ud589\ud588\uc5c8\ub2e4. \ucc98\uc74c \ubc30\uc6b0\ub294 \uac83\ub4e4\uc774 \uc6cc\ub099 \ub9ce\uc544\uc11c\uc778\uc9c0 \ub098\uc758 \uccab \uc2a4\ud130\ub514\ub294 \uc77d\ub294\ub370\uc5d0\ub9cc \uae09\uae09\ud588\uc5c8\ub358 \uac83 \uac19\ub2e4. \\n\uc2a4\ud130\ub514 \uc9c4\ud589 \ubc29\uc2dd\uc740 \ub300\uba74\uacfc \ube44\ub300\uba74\uc744 \uaca9\uc8fc\ub85c \uc9c4\ud589\ud558\uc600\uace0, github\ub97c \uc774\uc6a9\ud574 \ud559\uc2b5\ud55c \ub0b4\uc6a9\uc744 \uc815\ub9ac\ud574\uc11c PR\uc744 \ub0a0\ub9ac\ub294 \ubc29\uc2dd\uc73c\ub85c \uc9c4\ud589\ud558\uc600\ub2e4.\\n\\n<img src=\\"/img/github0.png\\"/>\\n\uc0ac\uc2e4 \uc704 \ubc29\uc2dd\uc744 \ucc44\ud0dd\ud588\uc744 \ub54c \ucc98\uc74c\uc5d0\ub294 \ub2e4\ub4e4 \uc131\uc2e4\ud558\uac8c \uc815\ub9ac\ud558\ub2e4\uac00 \ub098\uc911\uc5d0\ub294 \uc815\ub9ac\ud560 \uc0ac\ub78c\ub9cc \uc815\ub9ac\ud558\uc790\uace0 \uc758\uacac\uc774 \ub098\uc640 \ud750\uc9c0\ubd80\uc9c0 \ub418\uc5c8\ub2e4.\\n\uc560\ucd08\uc5d0 \uc774\ub7ec\ud55c \ubc29\uc2dd\uc758 \ub2e8\uc810\uc740 \ub2e4\uc74c\uacfc \uac19\uc558\ub2e4.\\n  - \uc77d\uae30\ub9cc \ud558\ub294 \uc218\ub3d9\uc801\uc778 \ud559\uc2b5 \ubc29\ubc95\uc774\ub2e4. \uc774\ub294 \uae30\uc5b5\uc5d0\uc11c \uc27d\uac8c \uc78a\ud600\uc9c4\ub2e4.\\n  - \ucc45\uc5d0\uc11c \uc124\uba85\ud574\uc8fc\ub294 \ubd80\ubd84\uc5d0\uc11c \ub354 \uad81\uae08\ud55c \uc810\uc774 \uc874\uc7ac\ud558\ub294 \uacbd\uc6b0\uac00 \uc874\uc7ac\ud55c\ub2e4. \uc774\ub7ec\ud55c \uad81\uae08\ud55c \uc810\uc744 \uacf5\uc720\ud558\uace0 \uac19\uc774 \ud574\uc18c\ud558\uba74 \ub354 \ud070 \uc131\uc7a5\uc744 \uae30\ub300\ud560 \uc218 \uc788\uc9c0\ub9cc \uadf8\ub7f4 \uc218 \uc5c6\uc5c8\ub2e4\ub294 \uc810.\\n\\n\\n## \ub098\uc758 \ub450\ubc88\uc9f8 JS \uc2a4\ud130\ub514\\n\ub098\uc758 \ub450\ubc88\uc9f8 JS \uc2a4\ud130\ub514\ub294 \uad50\ub0b4\uc5d0\uc11c \ud504\ub860\ud2b8\uc5d4\ub4dc\uc5d0 \uad00\uc2ec\uc774 \uc788\ub294 \uc0ac\ub78c\ub07c\ub9ac \ubaa8\uc5ec \uc9c4\ud589\ud558\uac8c \ub418\uc5c8\ub2e4.\\n\uc774\ubc88 \uc2a4\ud130\ub514\ub294 \uc804\uacfc\ub294 \ub2e4\ub978 \ubc29\uc2dd\uc744 \uc9c4\ud589\ub418\uc5c8\ub2e4. \\n1. \uc2a4\ud130\ub514\uc6d0\uc740 \uac01\uc790 \ucc45\uc744 \uc77d\uc73c\uba70 \uc0dd\uae34 \uad81\uae08\uc99d\uc774\ub098 \uc124\uba85\uc774 \ubd80\uc871\ud558\ub2e4\uace0 \uc0dd\uac01\uc774 \ub4dc\ub294 \ubd80\ubd84\uc744 \ubb38\uc81c\uc758 \ud615\ud0dc\ub85c Notion \ud50c\ub7ab\ud3fc\uc5d0 \uc791\uc131\ud55c\ub2e4.\\n2. \uc9c8\ubb38\ub4e4\uc5d0 \ub2f5\ubcc0\uc790\ub97c \ub79c\ub364\ud558\uac8c \ubc30\uc815\ud55c\ub2e4.\\n3. \ub2f5\ubcc0\uc790\ub4e4\uc740 \uc9c8\ubb38\ub4e4\uc5d0 \uc131\uc2ec\uc131\uc758\uaecf \uc9c8\ubb38\uc790\uac00 \uc774\ud574\ud560 \uc218 \uc788\ub3c4\ub85d \uc815\ub9ac\ud55c\ub2e4. \\n<img src=\\"/img/notion1.png\\"/>\\n<img src=\\"/img/notion2.png\\"/>\\n\\n\uc774\ub7ec\ud55c \ubc29\uc2dd\uc744 \ucc44\ud0dd\ud568\uc73c\ub85c\uc368 \uc9c8\ubb38\uc790\ub294 \uc9c8\ubb38\uc5d0 \ub300\ud55c \ub2f5\ubcc0\uc744 \uc5bb\uc744 \uc218 \uc788\uc744 \ubfd0\ub354\ub7ec, \uad00\ub828\ud574\uc11c \ub2f5\ubcc0\uc790\uc640 \uc2ec\ub3c4 \uc788\ub294 \ub300\ud654\ub97c \uc9c4\ud589\ud560 \uc218 \uc788\uac8c \ub418\uc5b4 \uc9c8\ubb38\uc790\uc640 \ub2f5\ubcc0\uc790 \ubaa8\ub450 \uc9c0\uc2dd\uc758 \ub0b4\uc7ac\ud654\uac00 \uc77c\uc5b4\ub0a0 \uc218 \uc788\uc5c8\ub2e4.\\n\ubfd0\ub9cc\uc544\ub2c8\ub77c \uc9c8\ubb38\uc744 \ubc1b\uc740 \uc0ac\ub78c\uc740 \ub0b4\uac00 \uc0dd\uac01\uc9c0 \ubabb\ud55c \ubd80\ubd84\uc744 \uc9c8\ubb38\uc73c\ub85c \ubc1b\uc558\uc744 \ub54c \uc9c0\uc2dd\uc758 \ube48\ud2c8\uc744 \uba54\uafc0 \uc218 \uc788\ub294 \uadc0\uc911\ud55c \uc2dc\uac04\uc774 \ub418\uc5c8\ub2e4.\\n\\n\ud639\uc2dc \uc774 \uae00\uc744 \uc77d\ub294 \ub3c5\uc790\ub4e4\ub3c4 \ud55c \ubc88\ucbe4\uc740 \uc774\ub7ec\ud55c \uc2a4\ud130\ub514 \ubc29\uc2dd\uc744 \ucc44\ud0dd\ud574\ubcf4\ub294 \uac83\uc744 \ucd94\ucc9c\ub4dc\ub9b0\ub2e4. \ub2a5\ub3d9\uc801\uc73c\ub85c \ud559\uc2b5\uc744 \ud560 \uc218 \uc788\ub294 \ubc1c\ud310\uc774 \ub9c8\ub828\ub420 \uac83\uc774\ub77c\ub294 \uc0dd\uac01\uc774 \ub4e0\ub2e4."}]}')}}]);